/*Table structure for table `menu` */

DROP TABLE IF EXISTS `menu`;

CREATE TABLE `menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `url` varchar(64) DEFAULT NULL COMMENT 'url pattern(路径匹配规则)，比如用户发起/employee/basic/xxx的请求，将被后端拦截并匹配到/employee/basic/**规则，进而判断该用户是否具备相应角色来决定是否能访问相应接口',
  `path` varchar(64) DEFAULT NULL COMMENT '请求路径',
  `component` varchar(64) DEFAULT NULL COMMENT '组件名称',
  `name` varchar(64) DEFAULT NULL COMMENT '菜单项名称',
  `iconCls` varchar(64) DEFAULT NULL COMMENT '组件图标',
  `keepAlive` tinyint(1) DEFAULT NULL COMMENT '是否保活(标记): 离开该组件时，该组件是否保活，如果保活，则不销毁组件继续保存在内存中，切换回该组件时加载更快',
  `requireAuth` tinyint(1) DEFAULT NULL COMMENT '访问该页面是否需要先登录(标记): 比如登录组件不需要先登录，菜单项数据不由后端动态返回而是前端写死的时候要用到该字段，由后端动态返回的时候不需要该字段',
  `parentId` int(11) DEFAULT NULL COMMENT '父id，二级菜单的所属一级菜单在menu表的id',
  `enabled` tinyint(1) DEFAULT '1' COMMENT '菜单项是否启用',
  PRIMARY KEY (`id`),
  KEY `parentId` (`parentId`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COMMENT='菜单项数据，用于前端向后端请求动态返回的菜单项数据';

